description:
The city of Athens takes center stage in this unusual yet heart-warming film directed by veteran filmmaker Nicos Panayiotopoulos. The protagonist of the film takes us on a journey to discover life in Athens, through meeting numerous pedestrians and eating lots of fruit along the way. Adapted by the bestselling novel of the same name, THE FRUIT TREES OF ATHENS uncovers human connection through literature, travel and fruit, all through the bumbling misunderstandings of the hero, played to perfection by Greek actor and Athens native Lefteris Vogiatzis.
